// import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Router, Route, Switch } from 'react-router-dom';
import Channeling from './Component/Channeling/channeling';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Router>
          <Switch>
            <Route exact path="/channeling" component={Channeling} />
          </Switch>
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
